import './assets/jufb-bootstrap.css';
import { Main } from './components/Main';
import { Footer } from './components/Footer';
import { Header } from './components/Header';
import { BrowserRouter } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
    <div className="App">
      <Header />

      <Main />

      <Footer />
    </div>
    </BrowserRouter>
   );
}
export default App;
